pragma solidity >=0.4.21 <0.6.0;

contract Capstone {
    
    address private owner;

    enum Topic {crime, cyber, miscellaneous}
    enum Severity {low, moderate, extreme}
    enum Sex {Male, Female}

    struct FIR {
        string PlaceOfOccurance;
        string Name;
        string Adhar;        
        string Subject;
        string Address;
        string details;
        string Email;
        int256 MobileNo;
        int256 Telephone;
        int8 Age;
        int8 Pin;
        Topic topic;
        Severity severity;
        Sex sex;
    }

    mapping (address => uint256) public AddressToPolicestationcode;
    mapping (address => FIR) private FIRToAddress;

    constructor() public{
        owner = msg.sender;
    }

    function PlaceFir (
        string memory _laceOfOccurance,
        string memory _Name,
        string memory _Adhar,
        string memory _Subject,
        string memory _Address,
        string memory _details,
        string memory _Email,
        int256 _MobileNo,
        int256 _Telephone,
        int8 _Age,
        int8 _Pin,
        Topic _topic,
        Severity _severity,
        Sex _sex
    ) public {
        
    }

}
